const Button = (props) => {

    return (
      <div>
        {props.state === 0 ? <button onClick={props.start}>Start</button> : ""}

        {props.state === 1 ? <button onClick={props.stop}>Stop</button> : ""}

        {props.state === 2 ? <button onClick={props.resume}>Resume</button> : ""}

        {props.state === 2 ? <button onClick={props.reset}>Reset</button> : ""}
      </div>
    );
}

export default Button;
